// Default imports
import React, {Component} from 'react';

// Custom imports
import Nav from '../navbar/navbar';
import {connect} from 'react-redux';
import * as personalInfo from '../../actions/action';
import {FaEnvelope, FaGithub, FaLinkedin} from 'react-icons/fa';
import axios from "axios";
import Footer from "../../components/footer/footer";

class Contact extends Component {
    render() {
        const {firstName, lastName, email, gitProfileLink, linkedInLink, personalImageField} = this.props.personalInfo;
        return (
            // HTML here
            <div>
                <Nav/>
                <div className='container'>
                    <div className="section">
                        <div className='row'>
                            <h4>Contact details</h4>
                        </div>
                    </div>
                    <div className="divider"></div>
                    <div className='card'>
                        <div className='card-content'>
                            <span className='card-title center'>{firstName + ' ' + lastName}</span>
                            <div className='row'>
                                <img alt='person' className='col s12 m12 l6'
                                     src={axios.defaults.baseURL + personalImageField.url}/>
                                <div className='col s12 m12 l6'>
                                    <div style='vertical-align:middle'>
                                        <a href={'mailto:' + email} className='black-text'><FaEnvelope/> • {email}</a>
                                        <br/>
                                        <a href={gitProfileLink} className='black-text'><FaGithub/> • {gitProfileLink}
                                        </a>
                                        <br/>
                                        <a href={linkedInLink} className='black-text'><FaLinkedin/> • {linkedInLink}</a>
                                        <br/>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
                <Footer/>
            </div>
        )
    }
}

const mapStateToProps = (state) => {
    return state
};

// Default export
export default connect(mapStateToProps, personalInfo)(Contact);
